If we look at statement and advice we see that some values (mostly math expressions) are language independant. ---
type: normal
statement: content: en: How much is 9 * {a}? nl: Hoeveel is 9 * {a}? placeholders: {}
advice: content: en: You could calculate 10 * {a} and then subtract {a}. This yields {a} * 10 - {a} = {a * 10} - {a} = {a*9} nl: Je kan 10 * {a} berekenen en dan {a} daarvan aftrekken. Dit geeft {a} * 10 - {a} = {a * 10} - {a} = {a*9} placeholders: {}
parts: - type: number_entry prompt: content: en: Enter your answer in the inputbox nl: Geef je antwoord in in het invulveld placeholders: {} marks: 5 answer: a * 9
variables: a: 3 This is where placeholders come in. Placeholders can be specified by name and then be used in the content field by writing {name}. ---
type: normal
statement: content: en: How much is {formula}? nl: Hoeveel is {formula}? placeholders: formula: 9 * {a}
advice: content: en: You could calculate {times10} and then subtract {a}. This yields {result} nl: Je kan {times10} berekenen en dan {a} daarvan aftrekken. Dit geeft {result} placeholders: times10: 10 * {a} result: '{a} * 10 - {a} = {a * 10} - {a} = {a*9}'
parts: - type: number_entry prompt: content: en: Enter your answer in the inputbox nl: Geef je antwoord in in het invulveld placeholders: {} marks: 5 answer: a * 9
variables: a: 3 Task Recompile all exams. You should see no difference but there are less chances to have different formulas in the different languages. Info You can also use the placeholders the other way around. This is mainly useful when almost the whole string is maths and some small parts need to be translated. This might not work for all languages due to different grammar rules etc. For example: ---
content: "{command} $5x^2-10$."
placeholders: command: content: nl: Ontbind in factoren en: Factorize placeholders: {}
